      <button className="btn btnStr"><i class="uil uil-play"></i> Start</button>
      <button className="btnStp"><i class="uil uil-pause"></i> Stop</button>
      <button className="btnRst"><i class="uil uil-redo"></i> Reset</button>
    </div>
  );
};

export default Button;
